import React from 'react';
import logo from './images/logo.png';
import "./Header.css";


function Header() {
  return ( 
    
<div className = "Main"> 

<div className = "Main" >

 <img className = "mainimage" src = {logo} alt = "logo"> 
 
 </img>

</div>

 
 </div>



  )

}

export default Header;
